import AppBar from '@mui/material/AppBar';
import {AddLink} from "@mui/icons-material";
import {Link} from "@mui/material";


function Navbar(){
    return (
        <AppBar>
            <Link to='/'>Home</Link>
        </AppBar>
    );

}

export default Navbar;
